import React from 'react';
import './Navigation.css';

import Timer from './Timer'
import Menu from './Menu'
import { useState } from 'react';
function Navigation(props) {
    var MenuIdx = 1;
  return (
    <div id="Navigation">
      <Timer />
      <div id="MenuList">

        <Menu
          MenuIdx={MenuIdx++}
          Address="/"
          Content="HOME"
          onClickNav = {props.onClickNav}
        />
        <hr />
        <Menu
          MenuIdx={MenuIdx++}
          Address="/"
          Content="PROFILE"
          onClickNav = {props.onClickNav}
        />
        <hr />
        <Menu
          MenuIdx={MenuIdx++}
          Address="https://github.com/GaeTaeng?tab=repositories"
          Content="Github"
          onClickNav = {props.onClickNav}
        />
        <hr />
        <Menu
          MenuIdx={MenuIdx++}
          Address="https://www.linkedin.com/in/tae-hun-kim-434552168/"
          Content="LinkedIn"
          onClickNav = {props.onClickNav}
        />
        <hr />
        <Menu
          MenuIdx={MenuIdx++}
          Address="/"
          Content="테트리스"
          onClickNav = {props.onClickNav}
        />
        <hr />
        <Menu
          MenuIdx={MenuIdx++}
          Address="/"
          Content="게시판"
          onClickNav = {props.onClickNav}
        />

      </div>
    </div>
  )
}


export default Navigation
